var express = require('express');
var router = express.Router();

router.get('/', function (req, res) {
    var chains = {};

    chains.list = [];

    var chainMock = {};
    chainMock.type = "image";
    chainMock.value = "data:image/png;base64,";
    chains.list.push({type: "image1", value: chainMock.value});
    chains.list.push({type: "image2", value: chainMock.value});
    chains.list.push({type: "image3", value: chainMock.value});
    chains.list.push({type: "image4", value: chainMock.value});
    chains.list.push({type: "image5", value: chainMock.value});
    chains.list.push({type: "image6", value: chainMock.value});
    chains.list.push({type: "image7", value: chainMock.value});
    chains.list.push({type: "image8", value: chainMock.value});
    chains.list.push({type: "image9", value: chainMock.value});
    chains.list.push({type: "image10", value: chainMock.value});
    chains.list.push({type: "image11", value: chainMock.value});
    chains.list.push({type: "image12", value: chainMock.value});
    chains.list.push({type: "image13", value: chainMock.value});
    chains.list.push({type: "image14", value: chainMock.value});
    chains.list.push({type: "image15", value: chainMock.value});
    chains.list.push({type: "image16", value: chainMock.value});
    chains.list.push({type: "image17", value: chainMock.value});
    chains.list.push({type: "image18", value: chainMock.value});
    chains.list.push({type: "image19", value: chainMock.value});
    chains.list.push({type: "image20", value: chainMock.value});
    chains.list.push({type: "image21", value: chainMock.value});

    chains.list = chains.list.slice((req.query.page - 1) * 10, (((req.query.page - 1) * 10) + 10));

    chains.totalItems = 21;
    res.send(chains);
});

router.get('/:chainId', function (req, res) {
    var chainMock = {};
    chainMock.type = "image";
    chainMock.value = "data:image/png;base64,";
    res.send(chainMock);
});

module.exports = router;
